import {Home} from './pages/home/home';
import {About} from '/pages/about/about';

import './index.css'

function App() {
    return (
      <div id = "App" className="App">
          <Home/>
      </div>
    );
}


ReactDOM.render(<App />, document.getElementById('root'));
